    iv: CryptoJS.enc.Utf8.parse(iv),
    mode: CryptoJS.mode.CBC,
  });
  console.log("CryptoJS.enc.Utf8.stringify(cipher).toString()",CryptoJS.enc.Utf8.stringify(cipher).toString());
  console.log("txt",txt);
  return CryptoJS.enc.Utf8.stringify(cipher).toString();
}
